        super(props);
        this.str = this.props.str;
        this.constitution = this.props.constitution;
        this.dexterity = this.props.dexterity;
    }
    render() {
        return (
            <div>
                <p>Str = {attributes[str]}</p>
                <p>Constitution = {attributes[constitution]}</p>
                <p>Dexterity={attributes[dexterity]}</p>
            </div>
        );
    }
}

export default Hero;
